  const dispatch = useDispatch();

  const user = { name: 'Rei' };

  return (
    <>
      <div>てすと</div>
      <h1>Counter</h1>
      <h2>カウント: {state.count}</h2>
      <button onClick={() => dispatch('INCREMENT')}>+</button>
      <button onClick={() => dispatch('DECREMENT')}>-</button>
    </>
  );
};

